import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css'

function Table(props) {

  return (
    <div className="">
       {
          props.getData.length>0?
          (
            props.getData.map(e=>              
                <div className="each-task" key={e._id}>                                         
                      {e.task}

                      {e.type}


                      {e.describe}

                      {e.time}                                         
                </div>          
            )
          ) : 
          (
            <div>no data</div>
          )             
       }     
      </div>
  );
}

export default Table;
